  false,\n\t\"url\": null,\n\t\"notes\": \"Phase two will consist of post processing
  of the data collected. Aeroquest Optimal, Inc. shall process the digital elevation
  data from a precision airborne (LIDAR) survey within the entire project area. The
  proposed project area is approximately 6.3 million acres. The purpose of the survey
  is to obtain measurements of the bare ground surface, as well as top surface feature
  elevation data for providing geometry input to USACE hydraulic modeling program.
  This project for USACE, Vicksburg District was to provide digital orthophotography
  using DMC imagery for approximately 4,120 square miles located in NW Mississippi
  at a 2-foot pixel resolution.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
